import React, { Component } from "react";

//google-maps-react
import {
	Map,
	InfoWindow,
	Marker,
	GoogleApiWrapper,
	DrawingManager
} from "google-maps-react";

export class MapPage extends Component {
	constructor(props) {
		super(props);
		// this.props.google = {
		// }
	}

	render() {
		return (
			<div>
				<Map
					google={this.props.google}
					zoom={14}
					initialCenter={{
						lat: 47.6062,
						lng: -122.3321
					}}
				/>
				<DrawingManager />
			</div>
		);
	}
}

export default GoogleApiWrapper({
	apiKey: "AIzaSyAKWE1JinLb5yLSoxHiEjiq1CMuOqbx_s4"
})(MapPage);
